import React from 'react';
// import { NavLink } from 'react-router-dom';
const logo = require('../images/logo_bk.png')

function NavBar() {
    return (
        <nav class="navbar">
            <a class="navbar-brand" href="#">
                <img src={logo}  height="15" class="d-inline-block align-top" alt="" />
            </a>
        </nav>
    )
}

export default NavBar;
